import React, {FC} from "react";
import { IGoods } from "../types/types";
import GoodsItem from "./GoodsItem";
import '../App.css'
import { useNavigate, useParams } from "react-router-dom";

interface GoodsListProps {
    goods: IGoods[]
};

type ProductCardParams = {
    id: string;
}

const GoodsList: FC<GoodsListProps> = ({goods}) => {
    const navigate = useNavigate();
    const params = useParams<ProductCardParams>();

    return (
        <div className="goods-list__list">
            {goods.map( good => 
              <GoodsItem 
                key={good.id} 
                onClick={(goods) => navigate('/catalog' + params.id)} 
                // вот тут добавил хз зачем пока
                good={good} 
                />
            )}
        </div>
    );
};

export default GoodsList;
